    <nav style={{ padding: "10px", background: "#ddd", display: "flex", gap: "10px" }}>
      <Link to="/">Home</Link>
      <Link to="/inicio">In√≠cio</Link>
      <Link to="/contato">Contato</Link>
    </nav>
  );
};

export default Navbar;
